                "Selamat datang di dunia batin burung hantu yang sistematis dan analitis. Burung hantu memiliki preferensi untuk introversi dan lebih menikmati dunia batin mereka daripada ditemani anak-anak lain. Mereka bijaksana, kompeten, dan biasanya santai dengan kemampuan memecahkan masalah kompleks dengan cara yang tidak biasa. Mereka paling bahagia di lingkungan yang tidak terstruktur di mana mereka bebas untuk berpikir, mengotak-atik, dan mencari tahu bagaimana segala sesuatunya bekerja. Burung hantu cenderung menjadi pengamat yang pendiam yang puas dengan melihat orang atau aktivitas tetapi tidak selalu berpartisipasi kecuali diundang. Mereka tenang dan pendiam, bahkan selama krisis — ini adalah anak-anak yang tetap berkepala dingin dan banyak akal ketika emosi orang lain sedang tinggi. Mereka dapat beradaptasi dengan sebagian besar situasi dengan mudah karena kebutuhan mereka mudah ditentukan. Mereka benci diberi tahu apa yang harus dilakukan dan juga tidak ingin memberi tahu orang lain apa yang harus dilakukan.\n" +
                        "\n" +
                        "Dengan dunia yang penuh dengan pertanyaan, tujuan hidup mereka adalah mencari tahu segala sesuatunya sejujur \u200B\u200Bdan seakurat mungkin. Mereka cenderung menantang status quo, opini, dan/atau keyakinan orang dewasa, tidak peduli seberapa penting orang tersebut. Mereka cepat menemukan ketidakkonsistenan dalam percakapan dan menerima kritik atau ketidaksepakatan, menganggapnya konstruktif daripada pribadi. Termotivasi oleh nalar dan logika daripada perasaan, mereka cenderung tetap terpisah secara objektif melalui diskusi apa pun. Akibatnya, Burung Hantu tanpa sadar dapat menyinggung perasaan orang lain dengan kritik keras mereka dan dapat terlihat tidak peduli. Sangat membantu bagi orang dewasa untuk memahami bahwa analisis kritis mereka tentang dunia adalah sarana untuk memahami dan meningkatkan berbagai hal, dan mereka tidak bermaksud jahat atau kasar. Otak mereka secara alami analitis, logis, dan objektif. Mungkin sulit bagi orang lain untuk memahami kedalaman semua yang terjadi di balik ketenangan mereka. Namun, ketika diberikan lingkungan yang tepat, anak-anak ini berkembang pesat. Mereka menginginkan ketidaksesuaian, waktu tenang yang cukup, kemandirian, dan kebebasan untuk mengotak-atik apa pun yang mereka renungkan. Keingintahuan mereka tentang bagaimana segala sesuatu bekerja bercampur dengan analisis kritis mereka adalah kombinasi kuat yang dapat memecahkan banyak masalah dan menjadikan dunia tempat yang lebih baik (dan lebih fungsional).",
