                        "\n" +
                        "Anak-anak berang-berang benar-benar ingin tahu tentang kehidupan dan mengalaminya secara langsung. Mereka lebih suka berada di luar menikmati alam atau bermain olahraga daripada duduk di dalam kelas. Mereka merasa sulit untuk duduk diam karena energi mereka yang tinggi dan kebutuhan akan pengalaman kehidupan nyata — eksplorasi, observasi, dan membicarakannya. Mereka selalu dalam perjalanan dan siap untuk berpetualang. (Berang-berang adalah anak-anak yang memberikan serangan panik kepada orang dewasa karena keingintahuan dan kemauan mereka untuk mengambil risiko. Orang dewasa hampir harus berada dua langkah di depan mereka!)\n" +
                        "\n" +
                        "Dunia mereka riang dan spontan. Ingin melakukan perjalanan dadakan? Anak ini sudah siap! Berang-berang menikmati kejutan dan mengubah rencana pada menit terakhir. Karena mereka hidup pada saat ini, mereka membutuhkan pengarahan ulang yang konstan dan pengingat akan aturan, batasan, dan harapan. Jika sesuatu memicu rasa ingin tahu mereka, mereka tidak perlu memikirkan implikasi atau konsekuensi dari tindakan mereka. Keingintahuan mereka seperti, \"Saya ingin tahu bagaimana rasanya menyentuh api?\" dan kemudian tangan mereka segera mendukung rasa ingin tahu itu dengan mengatakan sesuatu seperti, “Saya tidak tahu, tapi kedengarannya sangat luar biasa! Ayo cari tahu!”\n" +
                        "\n" +
                        "Anak-anak berang-berang berkembang pesat ketika diberi tujuan, pekerjaan, atau tanggung jawab yang mereka pedulikan dan menjadi milik mereka. Mereka membutuhkan orang dewasa yang tahu bagaimana menyalurkan energi tinggi mereka tanpa menekan semangat ceria mereka. Kecintaan mereka terhadap orang-orang dan pengalaman kehidupan nyata, bercampur dengan kepercayaan diri mereka, membuat kombo yang kuat yang secara signifikan dapat membuat dunia menjadi tempat yang lebih baik (dan lebih menyenangkan!).",
                "https://www.youtube.com/watch?v=rkczkn998JI;https://www.youtube.com/watch?v=3G81qlgvPko;https://www.youtube.com/watch?v=RkNdYAP5mwg&list=PL_DANuu1-w9pTPqXgaATYxvK7paI1IUjh&index=30;https://www.youtube.com/watch?v=64fLmIWHtT4&list=PL_DANuu1-w9pTPqXgaATYxvK7paI1IUjh&index=31;https://www.youtube.com/watch?v=LsvrcD_BMqU&list=PL_DANuu1-w9pTPqXgaATYxvK7paI1IUjh&index=70",
