                "Logis, Bertekad dan Terlahir Untuk Memimpin",
                "Pemimpin yang loyal, tegas, dan kompeten. Collie adalah kata Gaelik Skotlandia untuk \"berguna\" dan itu benar untuk anak-anak ini! Paling bahagia saat bertanding atau bertugas. Bangga pada kecerdasan mereka dan ingin orang lain mengenali ini juga",
                "Selamat datang di dunia Border Collie yang didorong, kompetitif, dan logis! Mereka adalah ekstrovert yang suka berbicara dan merupakan pemimpin alami. Mereka ingin bertanggung jawab dan mengubah segalanya menjadi kompetisi. Sejak usia sangat muda, mereka didorong oleh tujuan dalam setiap aspek kehidupan mereka, seperti akademis, olahraga, dan hobi. Dengan standar tinggi untuk menghasilkan hasil, anak-anak ini tidak memiliki masalah untuk memimpin dengan menuntut kekuatan dan kontrol. Prestasi adalah tongkat pengukur untuk Border Collies, memberi mereka kegembiraan dan kepuasan. Mereka sangat kompeten dan menginginkan pengaruh dalam segala situasi untuk memastikan segala sesuatunya dilakukan dengan benar. Sikap saya-bisa-melakukan-apa saja-saya-menetapkan-pikiran-saya-untuk-melakukan tampaknya dibangun di dalamnya.\n" +
                        "\n" +
                        "Termotivasi oleh alasan dan logika daripada perasaan, Border Collies berorientasi pada fakta. Mereka cenderung tetap tidak terikat secara objektif, bahkan di tengah situasi yang penuh tekanan. Border Collies sangat percaya diri dengan sikap menang dengan segala cara. Mereka adalah orang-orang yang berprestasi di hampir semua bidang, bermotivasi tinggi dan secara alami kompetitif, baik dengan orang lain maupun untuk memperbaiki rekor mereka sendiri. Mereka menikmati tantangan dan tidak pernah puas dengan yang kurang dari yang terbaik. Sangat terorganisir, analitis, dan sistematis, mereka lebih suka aturan yang masuk akal, dan mereka menghargai komunikasi yang jelas, yang membantu mereka mematuhinya. Jika mereka tidak setuju atau memahami aturan, mereka cenderung menantang orang dewasa yang menetapkan aturan. Mereka paling bahagia saat memimpin dan mengatur kelompok sebaya mereka untuk menghasilkan hasil.\n" +
                        "\n" +
                        "Anak-anak Border Collie akan menjadi pemimpin dan membutuhkan orang dewasa yang sabar yang akan membantu mereka mengembangkan kualitas kepemimpinan yang efektif. Mereka sangat puas menjadi pemimpin dan kemungkinan besar akan berada di posisi kepemimpinan untuk semua atau sebagian dari kehidupan mereka. Pengorganisasian datang secara alami kepada mereka, dan mereka adalah delegator yang sangat baik. Border Collies akan mendelegasikan, mengatur, dan mengekspresikan kemampuan kepemimpinan mereka dalam konteks keluarga. Apa tempat yang bagus untuk belajar! Namun, ketika mereka melampaui batas, beri tahu mereka. Mereka membutuhkan orang dewasa yang akan menetapkan batasan dan menyalurkan energi mereka. Border Collies akan menghormati dan senang bekerja di bawah otoritas selama mereka tahu dan mengerti apa yang diperbolehkan dan apa yang tidak diperbolehkan. Sikap Border Collies yang menyenangkan dan suka berteman bercampur dengan rasa tanggung jawab mereka membuat kombo yang kuat yang dapat secara signifikan meningkatkan dan memajukan dunia.",
